import React, { Component } from "react";

export default class CartShoe extends Component {
  rendertbody() {}
  render() {
    return (
      <div className="container py-5">
        <table className="table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Image</th>
              <th>Price</th>
              <th>Amount</th>
            </tr>
          </thead>
          <tbody>{this.rendertbody()}</tbody>
        </table>
      </div>
    );
  }
}
